import React, { Component } from 'react';
//import {ReactComponent as Aries} from './assets/1Aries.png';

class Aztro extends Component {
    constructor(props){
        super(props);
        this.state = {
          json: {}
        }
    }

    componentDidMount () {
        const URL = 'https://aztro.sameerkumar.website/?sign=aries&day=today';
        fetch(URL, {
            method: 'POST'
        }).then(response => response.json())
        .then(json => { this.setState({json}); });
    }

    render() {
        return (
		<table>
		<tr>
			<td><div class = "aries">
				<button onclick="myFunction()"><img src="https://i.imgur.com/pa5dvx0.png" width="100" height="100"></img></button>
			</div></td>
			<td><div class = "taurus">
				<button onclick="myFunction()"><img src="https://i.imgur.com/WYv5Lry.png" width="100" height="100"></img></button>
			</div></td>
			<td><div class = "gemini">
				<button onclick="myFunction()"><img src="https://i.imgur.com/8Z59vyz.png" width="100" height="100"></img></button>
			</div></td>
			<td><div class = "cancer">
				<button onclick="myFunction()"><img src="https://i.imgur.com/qcHIjt8.png" width="100" height="100"></img></button>
			</div></td>
		</tr>
		
		<tr>
			<td><div class = "leo">
				<button onclick="myFunction()"><img src="https://i.imgur.com/kJ8UqgI.png" width="100" height="100"></img></button>
			</div></td>
			<td><div class = "virgo">
				<button onclick="myFunction()"><img src="https://i.imgur.com/JVxM4n2.png" width="100" height="100"></img></button>
			</div></td>
			<td><div class = "libra">
				<button onclick="myFunction()"><img src="https://i.imgur.com/m0iPdYX.png" width="100" height="100"></img></button>
			</div></td>
			<td><div class = "scorpio">
				<button onclick="myFunction()"><img src="https://i.imgur.com/EMWFhol.png" width="100" height="100"></img></button>
			</div></td>
		</tr>
		
		<tr>
			<td><div class = "aries">
				<button onclick="myFunction()"><img src="https://i.imgur.com/pa5dvx0.png" width="100" height="100"></img></button>
			</div></td>
			<td><div class = "taurus">
				<button onclick="myFunction()"><img src="https://i.imgur.com/WYv5Lry.png" width="100" height="100"></img></button>
			</div></td>
			<td><div class = "gemini">
				<button onclick="myFunction()"><img src="https://i.imgur.com/8Z59vyz.png" width="100" height="100"></img></button>
			</div></td>
			<td><div class = "cancer">
				<button onclick="myFunction()"><img src="https://i.imgur.com/qcHIjt8.png" width="100" height="100"></img></button>
			</div></td>
		</tr>
		</table>
        );
    }
}

export default Aztro;
